import React,{useState} from 'react';
import {Box,Tab,Tabs,Text,Button} from 'grommet';
import '../App.css';

function Vdeomngr(props) {
    

    return (
        <>
        <Box fill direction="column" pad="small">
            <Box width="xxlarge" direction="row" justify="between">
                <Box direction="row">
                    <Text color="black" size="medium">Videos</Text>
                    <Box pad="small" round="full">5</Box>
                </Box>
            </Box>

        </Box> 
            
        </>
    )
}
export default Vdeomngr;
